    false,nt"url": null,nt"notes": "This protocol describes in detail every
    aspect of how fortuitous specimens from the Rocky Mountain Arsenal National Wildlife
    Refuge (Refuge) will be handled by the U.S. Fish and Wildlife Service (Service)
    and its contractors. Before a specimen will be submitted for chemical analysis,
    several criteria will have to be met, as outlined in the following protocol. Specimens
    which do not meet those criteria will be archived by the Service until decisions
    regarding their final disposition have been made. Certain species will also be given
    priority over others, as dictated by the needs of the service's natural resource
    damage assessment. In addition, since the fortuitous specimen program is an important
    component of the Service's natural resource damage assessment at the Arsenal, specimens
    will be handled under strict chain of custody procedures, which are also outlined
    in the protocol. The overall objective for the fortuitous specimen program is to
    develop a database on tissue contaminant concentrations and potential causes of
    morbidity or mortality in animals found on the Refuge.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
